import React from "react";
import { useHistory } from "react-router-dom";



function Home() {

  const history = useHistory();

  const handleClick = () => {
    history.push("/Crash");
  };

  return (
    
    <div >
        <div class="pagesGame">
          <div class="poza1" onClick={handleClick}></div>
          <div class="poza2"></div>
          <div class="poza3"></div>
        
      </div>
    </div>
  );
}

export default Home;
